import React from "react";
import { Form, Typography, Input, Button, Card } from "antd";
import { UserOutlined, LockOutlined } from "@ant-design/icons";
import { Link } from "react-router-dom";
const layout = {
  labelCol: { span: 5 },
  wrapperCol: { span: 24 }
};

const tailLayout = {
  wrapperCol: { offset: 6, span: 16 }
};

const SignIn = ({ onhandleAdd, onhandleFail }) => {
  return (
    <Card bordered={false}>
      <Form
        {...layout}
        name="normal_login"
        className="login-form mt-5"
        hideRequiredMark
        onFinish={onhandleAdd}
        onFinishFailed={onhandleFail}
      >
        <Form.Item>
          <Typography.Title className="text-center ml-5">
            SignIn
          </Typography.Title>
        </Form.Item>
        <Form.Item
          label="Email"
          name="email"
          rules={[
            {
              required: true,
              type: "email",
              message: "Please input your Email!"
            }
          ]}
        >
          <Input className="site-form-item-icon" prefix={<UserOutlined />} />
        </Form.Item>

        <Form.Item
          label="Password"
          name="password"
          rules={[
            {
              required: true,
              message: "Please input your password!"
            }
          ]}
        >
          <Input.Password
            prefix={<LockOutlined />}
            className="site-form-item-icon"
          />
        </Form.Item>

        <Form.Item {...tailLayout}>
          <Button
            type="primary"
            htmlType="submit"
            className="login-form-button"
          >
            Submit
          </Button>
          <Link to="/register">or Register</Link>
        </Form.Item>
      </Form>
    </Card>
  );
};

export default SignIn;
